import React, { useState } from 'react';

function Sidebar() {
  const [isSidebarOpen, setSidebar] = useState(false);
  const toggleSidebar = () => setSidebar(!isSidebarOpen);

  return (
    <div className={`sidebar-container ${isSidebarOpen ? 'open' : 'closed'}`}>
      <button className="sidebar_button" onClick={toggleSidebar}>â˜°</button>
      <div className="sidebar_content">
        <ul className="sidebar_list">
          <li className="sidebar_item">Home</li>
          <li className="sidebar_item">About Us</li>
          <li className="sidebar_item">Contact Us</li>
          <li className="sidebar_item">Log Out</li>
          <li className="sidebar_item">Help</li>
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
